{'review_id': 1971, 'comment': 'Thật sự lần đầu tiên mua hàng có giá trị lớn trên Tiki có hơi sợ. Mọi ng xung quanh đều bảo: Coi chừng mai nhận đc cục gạch :)))). 

Nhưng không nhé, anh shipper xếp các kiện hàng rất cẩn thận, ngay ngắn. Đóng gói thì chống sốc mấy lớp dày. Lúc mình kiểm hàng anh còn hỏi: Bộ điện thoại sao mà sợ dữ vậy em. Mình tức cười gần chết.

Túm lại: Hàng ngon, giá ngon, shipper cũng ngon. Điểm 10 cho tất cả', 'summary': 'Cực kì hài lòng', 'annotations': {'24': ['mẫu mã +', 'ship +', 'giá +'], '22': ['giá +', 'ship +']}}

{'review_id': 1092, 'comment': 'Đóng gói tốt, sản phẩm còn nguyên sale, chưa kích hoạt bảo hành, không bao gồm sạc và tai nghe. Sạc hôm bữa mình tham gia chơi Góp vàng nuôi Gióng nên có sẵn sạc 20W.

Mình đặt thứ hôm 7, đến thứ 4 là có hàng (vận chuyển từ HN-SG)

Mua trúng đợt 12/12, kết hợp thẻ tín dụng nên cũng giảm được chút ít.', 'summary': 'Hàng mới 100%', 'annotations': {'16': ['phụ kiện -', 'chính hãng +', 'typo', 'ship +'], '22': ['chính hãng +', 'ship +']}}

{'review_id': 24030, 'comment': 'Lột máy ra cứ có cảm giác là hàng đã bị kích hoạt rồi, vì OS sẵn là ipad os 13 chứ không phải ios 12. Đăng nhập các kiểu xong thì ngày bảo hành là 29-11-2020 (trong khi mình kích hoạt ngày 27 tháng 12, tức là mất gần 1 tháng)
Vậy đây là hàng trôi bảo hành. Mà hàng trôi bảo hành phải là hàng sản xuất ở đợt đầu sao mà os 13 được không hiểu luôn

nhưng vì mình mua giá rẻ ... cộng giảm giá các kiểu lại ra 10tr5 ... nên thôi nghĩ tiền nào của nấy cho rồi', 'summary': 'Mất 1 tháng bảo hành', 'annotations': {'24': ['mẫu mã -'], '22': ['giá +', 'chính hãng +']}}

{'review_id': 1241, 'comment': 'Đã nhận hàng sớm 1 ngày. MH rộng, dễ sử dụng. Có thể ẩn bớt các ứng dụng k cần thiết trên MH.

Camera trước lúc cần dùng mới tự động đẩy lên, rất sợ bị hỏng luôn á.

Pin dùng khá lâu. Dùng thêm mới đánh giá kỹ chất lượng được.', 'summary': 'Cực kì hài lòng', 'annotations': {'16': ['cấu hình +', 'typo', 'ship +'], '22': ['other']}}

{'review_id': 22911, 'comment': 'Loa note 20 nghe nhỏ hơn đt tầm trung của samsung

Phím âm lượng nằm bên tay phải cùng nút nguồn, thấy hơi bất tiện vì mình quen thói chỉnh phím âm lượng bên tay trái

Bảo hành điện tử kích hoạt ngày 22/9, tính tới lúc mình order thì khoảng 3 tuần -> vẫn tốt. Đt có sẵn miếng dán màn hình khi nhận', 'summary': 'Cực kì hài lòng', 'annotations': {'21': ['cấu hình -', 'phụ kiện +']}}

{'review_id': 1124, 'comment': 'Giao hàng nhanh, điện xoại xịn, xài rất mượt và sang luôn, camera chụp rất đẹp, sạc pin siêu nhanh (40p - 70p là đầy), mỗi tội pin xài hao quá cần phải tối ưu: tắt thông báo, tắt ứng dụng chạy ngầm,... thì mới đỡ hơn được.

Được tặng cái bao da tưởng ko xịn ai ngờ xịn ko tưởng, cầm chắc tay lắm, góc phải là mặt kính nên tiện xem giờ, thông báo và có thể bắt máy cuộc gọi được luôn khỏi cần mở nắp ra, tuy nhiên nó màu đen bề ngoài nhìn vào tưởng cục sạc dự phòng không á (đi nhậu mà để điện thoại trên bàn chả sợ thằng nào trộm vì nó nghĩ là sạc dự phòng nên cũng chả thèm lấy... đùa tí =)) ) 

Nói chung mua đợt này trên Tiki hàng chính hãng mà tiết kiệm hơn 7tr so với mua ở TGDĐ thì quá ngon rồi các bạn ạ.', 'summary': 'Tổng thể là oke', 'annotations': {'24': ['phụ kiện +', 'hiệu năng +', 'ship +'], '16': ['giá +', 'mẫu mã +', 'phụ kiện +', 'cấu hình +', 'hiệu năng +', 'ship +'], '22': ['mẫu mã +', 'phụ kiện +', 'hiệu năng +', 'ship +']}}

