{'review_id': 22239, 'comment': 'Thật sự rất bực mình vì đã sử dụng giao dịch trả góp mà từ hôm 11/11 đến bây giờ bên phía ngân hàng vẫn báo là chưa nhận được yêu cầu chuyển đổi trả góp của Tiki (mình cứ cách ngày là gọi điện cho ngân hàng để check). Trong khi đã đến ngày sao kê và nguy cơ cao là không thực hiện được giao dịch trả góp và bên ngân hàng vẫn giục thanh toán vì đã qua ngày sao kê. Nếu vậy thì phí mất cái mã giảm giá 1 triệu, do trả góp thì không áp dụng được mã giảm giá.

Ngoài ra, mua và sử dụng TikiNow 3h nhưng nhận hàng được rất muộn (tuy vẫn trong ngày 11/11).

Cuối cùng là máy rất hay bị báo lỗi sim (No sim card inserted) khi vào khu vực không có sóng thời gian dài chứ không chỉ là không có dịch vụ (No services). Cứ phải lấy sim ra cắm lại rất khó chịu. Thành ra đi công tác cứ phải mang theo cái que chọc sim (do tính chất công việc). Tuy nhiên nếu chỉ ở thành phố hoặc nơi có sóng tốt thì hiện tượng này hiếm khi xảy ra.', 'summary': 'Rất không hài lòng', 'annotations': {'18': ['ship -', 'dịch vụ -']}}

