{'review_id': 24042, 'comment': 'Mình vừa nhận hàng xong và giờ máy đang cập nhật phần mềm lên phiên bản mới. 

Nhận xét cho bạn nào đang tìm hiểu và có ý định mua. Cảm quan ban đầu là máy đẹp, chất lượng hoàn thiện tốt, trọng lượng cầm lâu cũng hơi mỏi tay chứ không nhẹ lắm. Màn hình không chống vân tay nên bám bẩn dã man, tấm nền hơi rỗ và xấu, màu sắc nhợt nhạt. Củ sạc đi kèm máy chỉ là 5V-1A trong khi dòng tối đa máy nhận được là 5.2V-1.8A nên sạc hơi chậm, nếu có thể thì mọi người nên dùng củ sạc 2A sạc sẽ nhanh hơn nhiều. 

Nói chung là với tầm giá 1,568tr thì rất đáng mua với 1 chiếc máy chính hãng như thế này. Không có gì phải phàn nàn cả ^^', 'summary': 'Đáng mua ☺️', 'annotations': {'24': ['cấu hình -', 'giá +', 'mẫu mã +'], '22': ['chính hãng +', 'mẫu mã +']}}

{'review_id': 1764, 'comment': 'Note 9S 6Gb Ram 128Gb bộ nhớ.
Mình xem trên 1 diễn đàn đánh giá những lỗi của dòng điện thoại này như: Loa nhỏ, rung yếu, mành hình hay bị tắt, pin tụt nhanh... thấy cũng lo. Nhưng sản phẩm mình mua, ngoài rung hơi yếu và ra ngoài ánh sáng mạnh hơi bị chói ra thì những vấn đề khác không xảy ra.

Máy mua về cập nhật mọi thứ xong chạy rất ổn, chưa bị lỗi nhỏ lỗi lớn nào xảy ra. Pin thì khá trâu bò, nếu biết cấu hình như tắt GPS, Bluetooth, tắt bớt các thông báo, các ứng dụng chạy ngầm không cần thiết thì pin đủ 2 ngày cho các nhu cần sử dụng bình thường. Nói chung, phân khúc tầm trung thì con máy này vô đối.', 'summary': 'Cực kì hài lòng', 'annotations': {'24': ['hiệu năng -', 'cấu hình +'], '16': ['cấu hình +'], '22': ['cấu hình -', 'hiệu năng -', 'phụ kiện -']}}

{'review_id': 22960, 'comment': 'Máy mới 100% nguyên seal chưa kích hoạt, bản của thị trường Mỹ, nếu sử dụng lâu dài mà không có vấn đề thì đây đúng là món hời với giá 9.090.000đ.

Vì đây là dòng giá rẻ của Apple, nên các bạn đừng đặt ra quá nhiều yêu cầu nhé, ví dụ: màn hình nhỏ, pin yếu, RAM ít, thiếu chế độ chụp hình (ban đêm, xóa phông vật ) ...

Đây là một chiếc điện thoại vừa phải của Apple với một mức giá dễ chịu, nếu muốn nhiều hơn nữa thì cứ thêm tiền để mua các dòng khác.', 'summary': 'Hài lòng', 'annotations': {'21': ['mẫu mã +', 'giá +']}}

{'review_id': 24230, 'comment': '🏆 Mình thanh toán trước khi nhận hàng. Giao hàng cũng như cách đóng gói rất tốt. 
🏆 Về điện thoại:
 🥇 đầu tiên là pin không trâu lắm tạm ổn;
 🥈 thứ hai là camera chụp ảnh khá thất vọng, không bằng 7 plus, mình khong rành kỹ thuật số cho lắm cứ nghĩ thông số camera 64mp thì chụp ảnh phải tốt chứ
 🥉 cuối cùng là thiết kế vân tay không nhạy, tay phải lau sạch mới ấn mở được, lúc gấp toàn phải bấm mật khẩu.', 'summary': 'Hài lòng', 'annotations': {'22': ['dịch vụ +', 'ship +']}}
